import React from 'react';
import animage from './me1.JPG';
import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <div className="App">

     <NavBar/>
      <div className="App-middle">Monica VO</div>
      <div className="App-right">
        <img src={animage} className="App-logo" alt="logo" />
      </div>
      <footer className="App-footer">
        <a
          className="App-link"
          href="https://wearecodenation.com/courses/coding/master/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Code Nation
        </a>
      </footer>

    </div>
  );
}

export default App;
